import './App.css'
import Homepage from "./components/homepage/homepage"
import Login from "./components/login/login"
import Register from "./components/register/register"
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { useState } from 'react';
import About from './components/navitems/about';
import Cart from './components/navitems/cart';
import Contact from './components/navitems/contact';
import Header from './components/header/header';
import LoginHeader from './components/header/loginheader';
import Adminregister from './components/admin/adminregister';
import Adminlogin from './components/admin/adminlogin';
import AdminHomepage from './components/admin/adminhome';


function App() {

  const [ user, setLoginUser] = useState({})
  const [ user1, setLoginUser1] = useState({})

  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/">
            <LoginHeader/>
            {
              user && user._id ? <Homepage setLoginUser={setLoginUser} /> : <Login setLoginUser={setLoginUser}/>
            }
          </Route>
          <Route  path="/adminhome">
            <LoginHeader/>
            {
              user1 && user1._id ? <AdminHomepage setLoginUser1={setLoginUser1} /> : <Adminlogin setLoginUser1={setLoginUser1}/>
            }
          </Route>
          <Route path="/login">
          <LoginHeader/>

            <Login setLoginUser={setLoginUser}/>

          </Route>
          <Route path="/adminlogin">
          <LoginHeader/>

            <Adminlogin setLoginUser1={setLoginUser1}/>

          </Route>
          <Route path="/register">
          <LoginHeader/>


            <Register />
          </Route>

          <Route path="/adminregister">
          <LoginHeader/>


            <Adminregister />
          </Route>

          <Route path="/about">
            <Header/>
          {
              user && user._id ? <About setLoginUser={setLoginUser} /> : <Login setLoginUser={setLoginUser}/>
            }
             {
              user1 && user1._id ? <About setLoginUser1={setLoginUser1} /> : <Adminlogin setLoginUser1={setLoginUser1}/>
            }

          </Route>
          <Route path="/cart">
          {
              user && user._id ? <Cart setLoginUser={setLoginUser} /> : <Login setLoginUser={setLoginUser}/>
            }
          </Route>
          <Route path="/contact">
          {
              user && user._id ? <Contact setLoginUser={setLoginUser} /> : <Login setLoginUser={setLoginUser}/>
            }
          </Route>
          <Route path="/header">
            <Header  />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
